import React from 'react';
import logo from './logo.svg';
import {BrowserRouter as Router} from 'react-router-dom';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from '.components/Navbar';

function App() {
  return (
     <React.Fragment>
      <Navbar/>
      <ProductList/>
      <Details/>
      <Cart/>
      <Default/>
    </React.Fragment>
  );
}

export default App;
